import React, { Component } from 'react';
import { List, Card } from 'antd';




class Resume extends Component {



  render() {


    const A = (props) => {
      return (
      <section id="resume">


      <div> <List
      grid={{ gutter: 16, column: 4 }}
      dataSource={props.data}
       renderItem={item => (
      <List.Item>
        <Card title={item.title}>Card content</Card>
      </List.Item>
      )}
      />
      </div>
   </section>
    )};
  }

}

export default Resume;
